import {Route, NavLink, Switch} from "react-router-dom";

import Nav from './components/navbar/navbar';

import './App.css';

function App() {
  return (
    <div className="App">
      <header></header>

      <body>
        <Nav />
        <div className="switch-container">
          <Switch>
            <Route exact path="/" component={Home} />
          </Switch>
        </div>
      </body>
    </div>
  );
}

export default App;
